import React,{useEffect} from 'react'
import M from "materialize-css/dist/js/materialize.min.js";


const SideNav = () => {


    // const handleOpenNav = () => {
    //     let sidenav = document.querySelector("#slide-out");
    //     M.Sidenav.init(sidenav, {});
    //     console.log('sidenav clicke')
    // }

    const handleCloseNav=()=>{
        let sidenav = document.querySelector("#slide-out");
        var instance = M.Sidenav.getInstance(sidenav)
        instance.close();
    }

    return (
        <>


<ul id="nav-mobile" class="sidenav sidenav-fixed" style={{transform: 'translateX(0%)'}}>



        <li class="search">
          <div class="search-wrapper">
          <div className="input-field">
              <input id="search" type="search" placeholder='Search for logs..' ref={''} onChange={handleSearchLogs}/>
              <label className="label-icon" htmlFor="search"><i className="material-icons">search</i></label>
              <i className="material-icons">close</i>
            </div>

            <div class="search-results"></div>
          </div>
        </li>


</ul>

         <a href="#!" data-target="slide-out" className="sidenav-trigger full hide-on-large-only"><i className="material-icons medium">menu</i></a>

        <ul id="slide-out" className="sidenav">
        <a href="#!" data-target="slide-out" onClick={handleCloseNav}><i className="material-icons waves-effect medium">close</i></a>


        <li><a href='#!' className="subheader">Logs Section</a></li>

          <li><a href="#!">Completed logs</a></li>
          <li><a href="#!">Uncompleted logs</a></li>

          <li><div className="divider"></div></li>
          <li><a href='#!' className="subheader">Techs Section</a></li>
          <li><a className="waves-effect" href="#!">Team</a></li>
        </ul>

      </>
    )
}

export default SideNav;
